  console.log("path: " + window.location.pathname)

  switch (window.location.pathname) {
    case "/":
      Component = App;
      break;
    case "/pricing":
      Component = Pricing;
      break;
    case "/about":
      Component = About;
      break;
  }

  // console.log("component:");
  // console.log(component);

  return (
    <>
      <Navbar></Navbar>
      {/* {component} */}
